import React from "react";
import { useParams } from "react-router-dom";
import dayjs from "dayjs";
import { getBookingsForWeek } from "../util";
import Tabs from "@material-ui/core/Tabs";
import Tab from "@material-ui/core/Tab";
import { Box, Typography } from "@material-ui/core";
import { makeStyles, withStyles } from "@material-ui/core/styles";

function TabPanel(props) {
  const { children, value, index, ...other } = props;
  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`scrollable-auto-tabpanel-${index}`}
      aria-labelledby={`scrollable-auto-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

const AntTabs = withStyles({
  root: {
    borderBottom: "1px solid #e8e8e8",
  },
  indicator: {
    backgroundColor: "#1890ff",
  },
})(Tabs);

const StyledTab = withStyles((theme) => ({
  root: {
    textTransform: "none",
    color: "#fff",
    fontWeight: theme.typography.fontWeightRegular,
    fontSize: theme.typography.pxToRem(15),
    marginRight: theme.spacing(1),
    "&:focus": {
      opacity: 1,
    },
  },
}))((props) => <Tab disableRipple {...props} />);

const Index = () => {
  const { roomId } = useParams();
  let now = "2019-09-23";

  let dataBooks = getBookingsForWeek({ now, roomId, weekNo: 1 });

  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const styleTime = {
    fontWeight: 400,
    fontSize: "16px",
    lineHeight: "100%",
    color: "#ffffff",
    opacity: "0.5",
  };

  const styleTitle = {
    fontWeight: 400,
    fontSize: "20px",
    lineHeight: "100%",
    color: "#ffffff",
  };

  return (
    <div style={{ display: "flex", width: "100%", height: "100vh" }}>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          backgroundColor: "#46529D",
          paddingLeft: "90px",
        }}
      >
        <div
          style={{
            width: "495px",
            height: "135px",
            backgroundColor: "#2EBAEE",
            marginBottom: "125px",
          }}
        >
          <div style={{ margin: "56px 0 25px 48px" }}>
            <span
              style={{ fontWeight: 700, fontSize: "54px", color: "#ffffff" }}
            >
              {roomId}
            </span>
          </div>
        </div>
        <span
          style={{
            fontFamily: "Lato",
            fontWeight: 700,
            fontSize: "18px",
            color: "#ffffff",
            marginBottom: "58px",
          }}
        >
          Upcoming
        </span>
        <span
          style={{
            fontWeight: 300,
            fontSize: "64px",
            lineHeight: "100%",
            color: "#ffffff",
            opacity: "0.5",
            marginBottom: "15px",
          }}
        >
          {dayjs(now).format("dddd")}
        </span>
        <span
          style={{
            fontWeight: 300,
            fontSize: "64px",
            lineHeight: "100%",
            color: "#ffffff",
            marginBottom: "68px",
          }}
        >
          {dayjs(now).format("DD MMM")}
        </span>
        {dataBooks
          .filter(
            (d) =>
              new Date(dataBooks[0].startTime).toDateString() ===
              new Date(d.startTime).toDateString()
          )
          ?.map((item, index) => {
            return (
              <div key={index} style={{ marginBottom: "16px" }}>
                <span style={styleTime}>
                  {dayjs(item.startTime).format("hh:mm")}
                  {" - "}
                  {dayjs(item.endTime).format("hh:mm")}
                </span>
                <div style={{ marginBottom: "8px" }} />
                <span style={styleTitle}>{item.title}</span>
              </div>
            );
          })}
      </div>

      <div
        style={{
          display: "flex",
          width: "100%",
        }}
      >
        <div>
          <div style={{ height: "88px" }}></div>
          <Tabs
            value={value}
            onChange={handleChange}
            indicatorColor="primary"
            textColor="primary"
            centered
          >
            <StyledTab label="Item One" />
            <StyledTab label="Item Two" />
            <StyledTab label="Item Three" />
          </Tabs>
          <TabPanel value={value} index={0}>
            Item One
          </TabPanel>
          <TabPanel value={value} index={1}>
            Item Two
          </TabPanel>
          <TabPanel value={value} index={2}>
            Item Three
          </TabPanel>
        </div>
      </div>
    </div>
  );
};

export default Index;
